import { useNavigate, useOutletContext } from "react-router-dom";
import { useForm } from "react-hook-form";
import {
  Wrapper,
  Logo,
  Form,
  Title,
  InputWrapper,
  InputContainer,
  Input,
  Label,
  Submit,
  FindWapper,
} from "../styles/loginSignup.styled";
import LogoSVG from "../components/Logo/LogoSVG";
import { GoToProps } from "../Root";
import { useState } from "react";

const Login = () => {
  const { goToMain, goToSignup } = useOutletContext<GoToProps>();

  const [focusStates, setFocusStates] = useState({
    id: false,
    password: false,
    passwordChack: false,
    email: false,
    phoneNum: false,
    verificationCode: false,
  });

  const navigate = useNavigate();
  return (
    <Wrapper>
      <Logo onClick={goToMain}>
        <LogoSVG />
      </Logo>
      <Form>
        <Title>MOVING 로그인</Title>
        <InputWrapper>
          <InputContainer>
            <Input type="text" placeholder="아이디" />
            <Label
              htmlFor="id"
              className={focusStates.id ? "focused" : ""}
            ></Label>
          </InputContainer>

          <Input type="password" placeholder="비밀번호" />
        </InputWrapper>
        <Submit
          type="submit"
          className="submitBtn"
          value={"로그인하기"}
          onClick={() => navigate("/")}
        />
        <FindWapper>
          <div className="findauth">
            <div onClick={() => alert("서비스 준비중 입니다.")}>
              아이디 찾기
            </div>
            <div onClick={() => alert("서비스 준비중 입니다.")}>
              비밀번호 찾기
            </div>
          </div>
          <div className="goToSignup">
            <p>아직 회원이 아니신가요?</p>
            <div className="signup" onClick={goToSignup}>
              회원가입
            </div>
          </div>
        </FindWapper>
      </Form>
    </Wrapper>
  );
};

export default Login;
